    function componentToHex(c) {
        var hex = c.toString(16);
        return hex.length == 1 ? "0" + hex : hex;
    }


    function interpolateColor(color1, color2, factor) {
        if (arguments.length < 3) {
            factor = 0.5;
        }
        var result = color1.slice();
        for (var i = 0; i < 3; i++) {
            result[i] = Math.round(result[i] + factor * (color2[i] - color1[i]));
        }
        return result;
    };


    function getGradientColor(value, minValue, maxValue) {
        const startColor = [99, 190, 123]; // #63BE7B
        const midColor = [255, 235, 132]; // #FFEB84
        const endColor = [248, 105, 107]; // #F8696B

        // Normalize value
        const range = maxValue - minValue;
        const normalizedValue = (value - minValue) / range;

        let color;
        if (normalizedValue <= 0.5) {
            // Scale factor between 0.0 and 1.0
            const scaleFactor = normalizedValue * 2;
            color = interpolateColor(startColor, midColor, scaleFactor);
        } else {
            // Scale factor between 0.0 and 1.0
            const scaleFactor = (normalizedValue - 0.5) * 2;
            color = interpolateColor(midColor, endColor, scaleFactor);
        }

        // Convert to hex
        return "#" + componentToHex(color[0]) + componentToHex(color[1]) + componentToHex(color[2]);
    }





    function mergeVolumesIntoGeoJSON() {
        const segmentsData = getSegmentVolume();
        const geojsonData = linestringdata();


        const volumes = segmentsData.map(segment => segment.volume);
        const minVolume = Math.min(...volumes);


        const maxVolume = Math.max(...volumes);

        geojsonData.features.forEach(feature => {
            const segment = segmentsData.find(segment => segment.id === feature.properties.id);
            if (segment) {
                feature.properties.volume = segment.volume;
                feature.properties.color = getGradientColor(segment.volume, minVolume, maxVolume);
                feature.properties.length = segment.length;
                feature.properties.limit = segment.limit;
                feature.properties.avgSpeed = segment["Avg. Speed"];
                feature.properties.in_out = segment.In_Out;
                feature.properties.volume_inout = segment.volume_InOut;
            }
        });

        return geojsonData;
    }







    function addArrow(map, lng, lat, color, heading, base64Arrow, volume, arrowType) {




        var el = document.createElement('div');
        el.className = 'arrow-marker ' + arrowType;
        el.style.display = 'none';
        var img = document.createElement('img');
        img.src = base64Arrow;
        img.style = 'transform: rotate(' + heading + 'deg); width: 52px; height: 52px;';
        el.appendChild(img);

        // Listen for zoom events on the map
        map.on('zoom', function () {
            // Show or hide the marker based on zoom level
            if (map.getZoom() >= 15) {
                img.style.visibility = 'visible';
            } else {
                img.style.visibility = 'hidden';
            }
        });



        // Prepare the popup content
        var popupContent = `<div style='border-radius: 5px; padding: 10px; background-color: ${color}; color: black;'>
        <p style='margin: 5px 0'>Volume: ${volume}</p></div>`;

        // Create a popup but don't automatically associate it with the marker
        var popup = new tt.Popup({
            offset: 35,
            closeButton: false,
            closeOnClick: false
        }).setHTML(popupContent);

        // Create and add the marker to the map
        var marker = new tt.Marker({
            element: el,
            anchor: 'bottom'
        }).setLngLat([lng, lat]).addTo(map);

        // Directly attach mouseover and mouseout event listeners to the marker element
        el.addEventListener('mouseover', function () {
            // When mouseover, set the popup's location to the marker's and add it to the map
            popup.setLngLat(marker.getLngLat()).addTo(map);
        });
        el.addEventListener('mouseout', function () {
            // Remove the popup from the map when mouseout
            popup.remove();
        });

        // map.setZoom(15);

        el.setAttribute('data-arrow-type', arrowType);
    }





    function addCircle(map, lng, lat, color, volume) {


        const segmentsData = getSegmentVolume();

        const volumes = segmentsData.map(segment => segment.volume);
        const minVolume = Math.min(...volumes);


        const maxVolume = Math.max(...volumes);


        var maxRadius = 25;

        var radius = ((volume - minVolume) / (maxVolume - minVolume)) * maxRadius;
        radius = Math.max(Math.min(radius, maxRadius), 10); // Ensure within bounds





        // Generate a unique ID for each circle
        var id = 'circle-' + lng + '-' + lat;

        // Check if the layer already exists and remove it if it does
        //   if (map.getLayer(id)) {
        //     map.removeLayer(id);
        //     map.removeSource(id);
        //   }

        // Add a new source with the circle data
        map.addSource(id, {
            'type': 'geojson',
            'data': {
                'type': 'Feature',
                'properties': {},
                'geometry': {
                    'type': 'Point',
                    'coordinates': [lng, lat]
                }
            }
        });

        // Add a new layer to display the circle
        map.addLayer({
            'id': id,
            'type': 'circle',
            'source': id,
            'paint': {
                'circle-radius': radius,
                'circle-color': color
            }


        });

        circleLayers.push(id);
        var popup = new tt.Popup({
            offset: 35
        });

        var icon = new tt.Popup({
            closeButton: false,
            closeOnClick: false
        });


        // Mouse enter event
        map.on('mouseenter', id, function (e) {
            map.getCanvas().style.cursor = 'pointer';
            var coordinates = e.features[0].geometry.coordinates.slice();

            var popupContent = ` <div style='border-radius: 8px; padding: 10px; background-color: ${color}; color: black;'>
        <p style='margin: 5px 0'>Volume: ${volume}</p></div>`;






            // Ensure the popup is at the correct location and set its content
            popup.setLngLat(coordinates)
                .setHTML(popupContent)
                .addTo(map);
        });

        // Mouse leave event
        map.on('mouseleave', id, function () {
            map.getCanvas().style.cursor = '';
            popup.remove();
        });



    }

    document.head.appendChild(script);


    

    document.getElementById('arrowVisibilityDropdown').addEventListener('change', function (e) {
                    var selectedOption = e.target.value;

                    // Query all arrow markers
                    var markers = document.querySelectorAll('.arrow-marker');

                    markers.forEach(function (marker) {
                        var arrowType = marker.getAttribute('data-arrow-type');
                        switch (selectedOption) {
                            case 'in':
                                marker.style.display = (arrowType === 'IN') ? '' : 'none';
                                break;
                            case 'out':
                                marker.style.display = (arrowType === 'OUT') ? '' : 'none';
                                break;
                            case 'both':
                                // marker.style.display = '';
                                marker.style.display = 'none';
                                break;
                        }
                    });
                });
